import React, { useState } from 'react';
import Usuarios from './Usuarios';
import Productos from './Productos';
import Proveedores from './Proveedores';
import Inventario from './Inventario';
import Ventas from './Ventas';

const PanelAdmin = () => {
  const [seccion, setSeccion] = useState('usuarios');

  const renderSeccion = () => {
    switch (seccion) {
      case 'usuarios': return <Usuarios />;
      case 'productos': return <Productos />;
      case 'proveedores': return <Proveedores />;
      case 'inventario': return <Inventario />;
      case 'ventas': return <Ventas />;
      default: return <Usuarios />;
    }
  };

  return (
    <div>
      <h2>Panel Administrativo</h2>
      <nav>
        <button onClick={() => setSeccion('usuarios-adminitrador')}>Usuarios</button>
        <button onClick={() => setSeccion('productos-adminitrador')}>Productos</button>
        <button onClick={() => setSeccion('proveedores')}>Proveedores</button>
        <button onClick={() => setSeccion('inventario')}>Inventario</button>
        <button onClick={() => setSeccion('ventas')}>Ventas</button>
      </nav>
      <hr />
      <div>{renderSeccion()}</div>
    </div>
  );
};

export default PanelAdmin;
